import { useNavigate } from "react-router-dom";
import "./BotoesInformacoes.css";

function BotoesInformacoes(props) {
    const navigate = useNavigate();

    function TestaDisponivel(){
      console.log(props.livro.bookshelf + " " + props.livro.available)
     if(props.livro.available && props.livro.bookshelf !==undefined)
      return(<button
        onClick={() => {
          navigate("/map", { state: { data: props.livro } });
        }}
      >
        localizar
      </button>)
    }

    props.livro.library = props.biblioteca.id;
  return (
    <div className="Botoes">
      <button
        onClick={() => {
          navigate("/");
        }}
      >
        sair
      </button>
      {TestaDisponivel()}
    </div>
  );
}
export default BotoesInformacoes;
